import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {
    return (
        <ul>
            <li>Learn React</li>
            <li>Build Awesome App</li>
        </ul>
    );
};

const AppHeader = () =>{
    return (
        <h1>My Todo List</h1>
    );
};

const el = (
    <div>
        <AppHeader/>
        <input placeholder="Search" />
        <TodoList/>
    </div>
);

ReactDOM.render(el, document.querySelector('#root'));
